import * as React from 'react';
import Link from '@mui/material/Link';
import Typography from '@mui/material/Typography';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import CssBaseline from '@mui/material/CssBaseline';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Container from '@mui/material/Container';
import Toolbar from '@mui/material/Toolbar';
import Paper from '@mui/material/Paper';
import Stepper from '@mui/material/Stepper';
import Step from '@mui/material/Step';
import StepLabel from '@mui/material/StepLabel';
import Button from '@mui/material/Button';
import CircularProgress from '@mui/material/CircularProgress';
import Grid from '@mui/material/Grid';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import PieChart from './PieChart';

function preventDefault(event) {
  event.preventDefault();
}

function ResultCard(props) {
  return (
    <React.Fragment>
      <Typography component="p" variant="h3">
        {props.value}
      </Typography>
      <Typography color="text.secondary" sx={{ flex: 1 }} variant="h6">
      {props.name}
      </Typography>
      <div>
        <Link color="primary" href="#" onClick={preventDefault} variant="subtitle1">
          View Article
        </Link>
      </div>
    </React.Fragment>
  );
}
const theme = createTheme();

export default function Result(){
    return (
        <ThemeProvider theme={theme}>
          <CssBaseline />
          <AppBar
            position="absolute"
            color="default"
            elevation={0}
            sx={{
            //   position: 'relative',
              borderBottom: (t) => `1px solid ${t.palette.divider}`,
            }}
          >
            <Toolbar>
              <Typography variant="h6" color="inherit" noWrap>
                Demo
              </Typography>
            </Toolbar>
          </AppBar>
          <Grid container spacing={0}>
          <Container maxWidth="xs">
            <Paper variant="outlined" sx={{ my: { xs: 3, md: 2 }, p: { xs: 2, md: 3 } }}>
            <Grid container spacing={0}>
            <Grid item xs={6}>
            <ResultCard name="Heart Disease" value="46%"/>
            
            </Grid>   
            <PieChart value={46}/>
            
            </Grid> 
              
              
              
            </Paper>
          </Container>

          <Container maxWidth="xs">
            <Paper variant="outlined" sx={{ my: { xs: 3, md: 2 }, p: { xs: 2, md: 3 } }}>
            <Grid container spacing={0}>
            <Grid item xs={6}>
            <ResultCard name="Diabetes" value="10%"/>
            </Grid>   
            
            </Grid> 
              
              
              
            </Paper>
          </Container>

          <Container maxWidth="xs">
            <Paper variant="outlined" sx={{ my: { xs: 3, md: 2 }, p: { xs: 2, md: 3 } }}>
            <Grid container spacing={0}>
            <Grid item xs={6}>
            <ResultCard name="Stroke" value="13%"/>
            </Grid>   
            
            </Grid> 
              
              
              
            </Paper>
          </Container>
          </Grid>
        </ThemeProvider>
      );
}
